export default function Home() {
    const Paragraph = styled.p `
        min-width: 5em;
        background-color: #1e1e1e;
        color: #fff;
        padding: 5em;
        font-family: Ar
    `
    return (
        <>
            <h1>Home</h1>
            <p>Esta é a home</p>
            <Paragraph>Este paragrafo está usando styled components</Paragraph>
        </>
    );
}
